import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './RankingBoard.css'; // 순위표 스타일 정의

const WeeklyChart: React.FC = () => {
    const [ranking, setRanking] = useState<any[]>([]); // 주간 인기 차트 데이터를 저장할 상태

    // 주간 인기 차트 데이터를 가져오는 API 호출
    useEffect(() => {
        axios.get('http://localhost:8080/api/v1/weekly-chart') // 주간 인기 차트 API 엔드포인트 (예시)
            .then((response) => {
                setRanking(response.data);
            })
            .catch((error) => {
                console.error('주간 인기 차트 데이터를 가져오는 중 오류 발생:', error);
            });
    }, []);

    return (
        <div className="weekly-chart">
            <h3>주간 인기 차트</h3>
            <ul>
                {ranking.map((rankItem, index) => (
                    <li key={index}>{index + 1}. {rankItem.title}</li>
                ))}
            </ul>
            <div className="chart-footer">월요일 00시 기준</div>
        </div>
    );
};

export default WeeklyChart;
